import React, { useState, useEffect } from 'react';
import axios from 'axios';

const App = () => {

  const [geocache, setGeocache] = useState([])

  const getGeocache = () => {
    axios
      .get('https://guarded-harbor-25892.herokuapp.com/api/caches')
      .then(
        (response) => setGeocache(response.data),
        (err) => console.error(err)
      )
      .catch((error) => console.error(error))
   }

   useEffect(() => {
    getGeocache()
   }, [])


  return (
    <>
      <h1>GEOCACHING</h1>
      <div className='geo'>
        {geocache.map((cache) => {
          return (
            <div className='cache' key={cache.id}>
              <h5>Name: {cache.name}</h5>
              <h5>Note: {cache.note}</h5>
              <h5>Latitude: {cache.lat}</h5>
              <h5>Longitude: {cache.long}</h5>
            </div>
          )
        })}
      </div>



    </>
  )
}

export default App
